  `winning_amount` decimal(8,2) DEFAULT NULL,
  `version` int(1) DEFAULT '0',
  `state` varchar(10) COLLATE utf8_bin DEFAULT NULL,
  `frequency` int(11) DEFAULT '0',
  `logo` longblob,
  `numbers` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `link` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `prev_drawing_date` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `next_drawing_date` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=420 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
